import React from 'react'

function FilterCard(props) {
  const { restarents } = props;
  {
    restarents.map((item) => {
      return (
        <div className='p-4 card'>
          <div className="card-body">
            <img className='card-img float-left image-fluid rounded-25' src={item.image} alt="" />
            <div className="">
              {console.log(restarents)}
              <h1>{item.name}</h1>
            </div>
          </div>
        </div>
      )
    })
  }

}

export default FilterCard
